import React from "react";

function Note() {
  const [note, setNote] = React.useState({
    title: "",
    content: "",
  });

  return (
    <div className="note">
      <div>
        <h3>{note.title}</h3>
        <p>{note.content}</p>
      </div>
      <button>
        <DeleteIcon />
      </button>
    </div>
  );
}

export default Note;
